import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Perform a search to get to results page with sort filter
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'electronics');
    await page.click('.search-btn:first-of-type');

    // Wait for search results and sort controls to load
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_results.png'));

    // Apply price sort filter (low to high)
    await page.selectOption('#sortSelect', 'price-low');

    // Wait for results to update
    await page.waitForTimeout(1000);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_sort.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_sort.png'));

    // Extract product prices to verify sort was applied
    const prices = await page.$$eval('.product-price', priceElements => 
      priceElements.map(el => {
        const priceText = el.textContent.match(/\$\d+\.\d+/)[0];
        return parseFloat(priceText.replace('$', ''));
      })
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high) and extracted product prices",
      extractedData: {
        prices: prices.slice(0, 5) // First 5 product prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
